INSERT INTO `Sms_smstemplate` VALUES (10,'181407','181408','親愛的客戶{{named}}，歡迎你蒞臨123醫務中心。剛才已為你接種了第一針乙型肝炎預防針，第二，三針將會在1，5個月後接種。乙型肝炎主要透過母嬰，血液和性接觸三種方法傳染。完成接種疫苗後可預防乙型肝炎所引發的急性肝炎，肝衰竭和肝癌。','温馨提示。親愛的客戶{{named}}，你在123醫務中心接種的乙型肝炎預防針，第二/三針已到期，你可以在診所辦工時間內來接種疫苗。請確定你身體狀況良好，沒有發燒，未來二天不需做劇烈運動。期待你的來臨！',1,1,'2020-06-24 08:26:44.523773',1,1),(11,'181407','181408','Dear {{named}}, welcome to 123 Medical Centre. You have just received your first dose of hepatitis B vaccine. The second and third dose will be 1, 5 month later respectively. Hepatitis B is transmitted via mother-to-infant, blood borne and sexual contact. Upon completion of the hepatitis B vaccination, one is protected against acute hepatitis, cirrhosis and hepatocarcinoma.','Warm Reminder. Dear {{named}}, your order on hepatitis B vaccine, second / third dose is due now. You may visit 123 medical centre during the opening hours for the vaccination. Please be reminded that you should feel good, no fever and no vigorous exercise in coming few days before coming for vaccination. We are looking forward to your visit.',2,1,'2020-06-24 08:27:38.503366',1,1),(12,'181429','181430','親愛的客戶{{named}}，歡迎你蒞臨123醫務中心。剛才已為你接種了第一針甲型肝炎預防針，第二針將會在6個月後接種。甲型肝炎主要是透過受污染的食水，污水清洗的生果和食用海鲜傳染。完成接種疫苗後可預防甲型肝炎所引發的急性肝炎。','温馨提示。親愛的客戶{{named}}，你在123醫務中心接種的甲型肝炎預防針，第二針已到期，你可以在診所辦工時間內來接種疫苗。請確定你身體狀況良好，沒有發燒，未來二天不需做劇烈運動。期待你的來臨！',1,1,'2020-06-26 13:57:30.366024',1,2),(13,'181429','181430','Dear {{named}}, welcome to 123 Medical Centre. You have just received your first dose of hepatitis A vaccine. The second dose will be 6 month later. Hepatitis A is transmitted by consumption of contaminated water, seafood and fruit cleaned by contaminated water. Upon completion of the hepatitis A vaccination, one is protected against acute hepatitis.','Warm Reminder. Dear {{named}}, your order on hepatitis A vaccine, second dose is due now. You may visit 123 medical centre during the opening hours for the vaccination. Please be reminded that you should feel good, no fever and no vigorous exercise in coming few days before coming for vaccination. We are looking forward to your visit.',2,1,'2020-06-26 13:58:28.947306',1,2),(14,'181431','181432','親愛的客戶{{named}}，歡迎你蒞臨123醫務中心。剛才已為你接種了第一針甲乙型混合肝炎預防針，第二，三針將會在1，5個月後接種。乙型肝炎主要透過母嬰，血液和性接觸三種方法傳染。甲型肝炎主要是透過受污染的食水，污水清洗的生果和食用海鲜傳染。完成接種疫苗後可預防甲 / 乙型肝炎所引發的急性肝炎，肝衰竭和肝癌。','温馨提示。親愛的客戶{{named}}，你在123醫務中心接種的甲乙型肝炎預防針，第二/三針已到期，你可以在診所辦工時間內來接種疫苗。請確定你身體狀況良好，沒有發燒，未來二天不需做劇烈運動。期待你的來臨！',1,1,'2020-06-26 14:01:24.694182',1,3),(15,'181431','181432','Dear {{named}}, welcome to 123 Medical Centre. You have just received your first dose of hepatitis A, B Twinrix vaccine. The second and third dose will be 1, 5 month later respectively. Hepatitis A is transmitted by consumption of contaminated water, seafood and fruit cleaned by contaminated water. Hepatitis B is transmitted via mother-to-infant, blood borne and sexual contact. Upon completion of the hepatitis A, B Twinrix vaccination, one is protected against acute hepatitis, cirrhosis and hepatocarcinoma.','Warm Reminder. Dear {{named}}, your order on hepatitis A / B Twinrix vaccine, second / third dose is due now. You may visit 123 medical centre during the opening hours for the vaccination. Please be reminded that you should feel good, no fever and no vigorous exercise in coming few days before coming for vaccination. We are looking forward to your visit.',2,1,'2020-06-26 14:02:36.687517',1,3),(16,'181434','181435','親愛的客戶{{named}}，歡迎蒞臨123醫務中心。你剛剛接種了第一針宮頸癌9價預防針，接下來的第二/三針將於第2 , 6個月接種。宮頸癌HPV 病毒主要透過性接觸或傷口傳染。感炎後會增加患宮頸癌，肛門癌，皮膚疣等機會。九價子宮頸癌預防針可預防 HPV 6, 11, 16, 18, 31, 33, 45, 52, 58, 九種常見的 過濾性病毒，從而減少患上子宮頸癌機會約9成。','温馨提示。親愛的客戶{{named}}，你在123醫務中心接種的 Gardasil 宮頸癌預防針，第二/三針已到期，你可以在診所辦工時間內來接種疫苗。請確定你身體狀況良好，沒有發燒，沒有懷孕，未來二天不需做劇烈運動。期待你的來臨！',1,1,'2020-06-26 14:07:27.718358',1,4),(17,'181434','181435','Dear {{named}},  welcome to 123 Medical Centre. You have just received the first dose of Gardasil HPV9 vaccine. The second / third dose will be st 2, 6 months later. Human Papilloma Virus infection mainly transmitted via sexual or direct contact. It increases risk of cervical cancer, anal cancer and skin wart. Gardasil 9 can prevent HPV 6, 11, 16, 18, 31, 33, 45, 52, 58 viral infection, it reduces cervical cancer by 90%.','Warm Reminder. Dear {{named}}, your order on Gardasil cervical cancer vaccine, second / third dose is due now. You may visit 123 medical centre during the opening hours for the vaccination. Please be reminded that you should feel good, no fever, not pregnant now and no vigorous exercise in coming few days before coming for vaccination. We are looking forward to your visit.',2,1,'2020-06-26 14:08:33.451976',1,4),(18,'181436','181437','親愛的客戶{{named}}，歡迎蒞臨123醫務中心。你剛剛接種了第一針破傷風針預防針，接下來的第二/三針將於第2 , 8個月接種。破傷風主要經過傷口傳染，特別是穿刺性傷口，會引致急性肌肉抽搐，死亡率可達6成。','温馨提示。親愛的客戶{{named}}，你在123醫務中心接種的破傷風預防針，第二/三針已到期，你可以在診所辦工時間內來接種疫苗。請確定你身體狀況良好，沒有發燒，未來二天不需做劇烈運動。期待你的來臨！',1,1,'2020-06-26 14:11:10.928648',1,5),(19,'181436','18147','Dear {{named}}, welcome to 123 Medical Centre. You have just received the first dose of tetanus vaccine. The second and third dose will be 2, 8 months later. Tetanus is mainly trasmitted by open wound, especially stab wound. It may cause acute local or generalised muscle spasm and even death.','Warm Reminder. Dear {{named}}, your order on ATT tetanus vaccine, second / third dose is due now. You may visit 123 medical centre during the opening hours for the vaccination. Please be reminded that you should feel good, no fever and no vigorous exercise in coming few days before coming for vaccination. We are looking forward to your visit.',2,1,'2020-06-26 14:11:56.954353',1,5),(20,'181438','181439','親愛的客戶{{named}}，歡迎蒞臨123醫務中心。你的小朋友剛剛接種了第一針季節性流感預防針，接下來的第二針將於第1個月接種。季節性流感主要經過飛沫傳染，患者會出現發燒，肌肉疼痛，傷風等症狀。每年9至1月是接種疫苗的最佳時間。照顧者亦應每年接種流感疫苗以保護小朋友。','温馨提示。親愛的客戶{{named}}，你在123醫務中心接種的季節性流感預防針，第二針已到期，你可以在診所辦工時間內來接種疫苗。請確定你身體狀況良好，沒有發燒，未來二天不需做劇烈運動。期待你的來臨！',1,1,'2020-06-26 14:13:36.649758',1,6),(21,'181438','181439','Dear {{named}},  welcome to 123 Medical Centre. Your child has just received the first dose of Seasonal Influenza vaccine. The second dose will be 1 month later. Seasonal Influenza may cause fever, myalgia and coryza. Each year, the best injection time is between September and January. Care givers are advised to receive flu vaccine to gain extra protection to their children.','Warm Reminder. Dear {{named}}, your order on influenza vaccine, second dose is due now. You may visit 123 medical centre during the opening hours for the vaccination. Please be reminded that you should feel good, no fever and no vigorous exercise in coming few days before coming for vaccination. We are looking forward to your visit.',2,1,'2020-06-26 14:14:39.939326',1,6),(22,'181440','181441','親愛的客戶{{named}}，歡迎蒞臨123醫務中心。你的小朋友剛剛接種了第一針輪狀病毒口服預防液，接下來的第二次將於第2,4個月接種。輪狀病毒主要經過不潔食物傳染，或小孩把不潔東西放進口中而感染，患者會出現發燒，嚴重嘔吐和肚瀉，嚴重者需要入院打點滴。','温馨提示。親愛的客戶{{named}}，你在123醫務中心接種的輪狀口服疫苗，第二/三針已到期，你可以在診所辦工時間內來接種疫苗。請確定你BB身體狀況良好，沒有發燒。期待你的來臨！',1,1,'2020-06-26 14:20:13.854931',1,7),(23,'181440','181441','Dear {{named}}, welcome to 123 Medical Centre. Your child has just received the first dose of Rotavirus oral vaccine. The second dose will be 2, 4 month later. Rotavirus is caused by ingestion of contamined food or putting things in mouth. It may results in fever, severe vomiting and diarrhea. Hospitalisation maybe required in severe case.','Warm Reminder. Dear {{named}}, your order on Rotavirus oral vaccine, second / third dose is due now. You may visit 123 medical centre during the opening hours for the vaccination. Please be reminded that your BB should feel good, no fever before coming for vaccination. We are looking forward to your visit.',2,1,'2020-06-26 14:20:55.970296',1,7),(24,'181442','181443','親愛的客戶{{named}}，歡迎蒞臨123醫務中心。你的小朋友剛剛接種了第一針乙型啫血流感預防針，接下來的第二次將於第2，第4個月接種。乙型嗜血流感主要經過飛沫和接觸傳染，患者會出現發燒， 流鼻水，咳嗽，扁桃腺發炎等症狀，嚴重者需要入院。','温馨提示。親愛的客戶{{named}}，你在123醫務中心接種的乙型嗜血流感預防針 (HiB)，第二/三針已到期，你可以在診所辦工時間內來接種疫苗。請確定你BB身體狀況良好，沒有發燒。期待你的來臨！',1,1,'2020-06-26 14:23:54.227357',1,13),(25,'181442','181443','Dear {{named}}, welcome to 123 Medical Centre. Your child has just received the first dose of Haemophilus influenza type b vaccine (HiB). The second dose will be 2, 4 month later. Hib is transmitted by droplet, direct contact. It may result in fever, coryz, tonsillitis and pneumonia. Hospitalisation maybe required in severe case.','Warm Reminder. Dear {{named}}, your order on Hemophilus influenza type B vaccine (HiB), second / third dose is due now. You may visit 123 medical centre during the opening hours for the vaccination. Please be reminded that your BB should feel good, no fever before coming for vaccination. We are looking forward to your visit.',2,1,'2020-06-26 14:24:25.634914',1,13),(26,'181444','181446','親愛的客戶{{named}}，歡迎蒞臨123醫務中心。你的小朋友剛剛接種了第一針乙型啫血流感預防針和第一針輪狀病毒口服預防液，接下來的第二次將於第2，第4，和第16個月接種。乙型嗜血流感主要經過飛沫和接觸傳染，患者會出現發燒，流鼻水，咳嗽，扁桃腺發炎等症狀，嚴重者需要入院。輪狀病毒主要經過不潔食物傳染，或小孩把不潔東西放進口中而感染，患者會出現發燒，嚴重嘔吐和肚瀉，嚴重者需要入院打點滴。','温馨提示。親愛的客戶{{named}}，你BB在123醫務中心接種的輪狀口服疫苗 / 乙型啃血流感預防針 (HiB)，第二/三/四針已到期，你可以在診所辦工時間內來接種疫苗。請確定你BB身體狀況良好，沒有發燒，飲食正常。期待你的來臨！',1,1,'2020-06-26 14:26:33.707778',1,8),(27,'181444','181446','Dear {{named}}, welcome to 123 Medical Centre. Your child has just received the first dose of Haemophilus influenza type b vaccine (HiB), and first dose of Rotavirus vaccination. The second dose will be 2, 4 and 16 month later. Hib is transmitted by droplet, direct contact. It may result in fever, coryz, tonsillitis and pneumonia. Rotavirus is caused by ingestion of contamined food or putting things in mouth. It may results in fever, severe vomiting and diarrhea. Hospitalisation maybe required in severe case.','Warm Reminder. Dear {{named}}, your order on Plan A. Rotavirus vaccine, Hemophilus Influenza type B vaccine (HiB), second / third /fourth dose is due now. You may visit 123 medical centre during the opening hours for the vaccination. Please be reminded that your BB should feel good, no fever and normal appetite before vaccination. We are looking forward to your visit.',2,1,'2020-06-26 14:27:06.610009',1,8),(28,'181448','181449','親愛的客戶{{named}}，歡迎蒞臨123醫務中心。你的小朋友剛剛接種了第一針五合一/ 六合一預防針和第一針輪狀病毒口服預防液，接下來的第二次將於第2，第4，和第16個月接種。你仍要到母嬰健康院接種13價肺炎預防針。乙型嗜血流感主要經過 飛沫和接觸傳染，患者會出現發燒， 流鼻水，咳嗽，扁桃腺發炎等症狀，嚴重者需要入院。輪狀病毒主要經過不潔食物傳染，或小孩把不潔東西放進口中而感染，患者會出現發燒，嚴重嘔吐和肚瀉，嚴重者需要入院打點滴。','温馨提示。親愛的客戶{{named}}，你BB在123醫務中心接種的輪狀口服疫苗 / 五合一 / 六合一 預防針 ，第二/三/四針已到期，你可以在診所辦工時間內來接種疫苗。請確定你BB身體狀況良好，沒有發燒，飲食正常。期待你的來臨！提醒你仍要到母嬰健康院為BB 接種13價肺炎預防針。',1,1,'2020-06-26 14:29:37.078104',1,9),(29,'181448','181449','Dear {{named}}, welcome to 123 Medical Centre. Your child has just received the first dose of 5 in 1 / 6 in 1, and first dose of Rotavirus vaccination. Your BB still need to receive Pneumococcal vaccine Prevenar 13 at MCHC. The second dose will be 2, 4 and 16 month later. Hib is transmitted by droplet, direct contact. It may result in fever, coryz, tonsillitis and pneumonia. Rotavirus is caused by ingestion of contamined food or putting things in mouth. It may results in fever, severe vomiting and diarrhea. Hospitalisation maybe required in severe case.','Warm Reminder. Dear {{named}}, your order on Plan D. Rotavirus vaccine, 5 in 1 / 6 in 1, second / third /fourth dose is due now. You may visit 123 medical centre during the opening hours for the vaccination. Please be reminded that your BB should feel good, no fever and normal appetite before vaccination. We are looking forward to your visit. You are reminded that your BB still need to receive pneumococcal Prevenar 13 vaccine at MCHC.',2,1,'2020-06-26 14:30:11.650159',1,9),(30,'181450','181450','親愛的客戶{{named}}，多謝你今天蒞臨123醫務中心，針對你今天做的小手術有幾個注意事項要提一提你\r\n1. 傷口今天不要濕水\r\n2. 若傷口出現異常痛楚 / 出血 / 麻痺感覺 / 爆線，請第一時間通知我們。Tel: 55448155 (Whatsapp / 微訊) / 37020123. \r\n3. 傷口癒合需要四大元素，包括適當溫度，濕度和透氣，並且沒有發炎。選擇適合敷料非常重要，記得先用藥水清洗傷口，再放上紗布。\r\n4. 大部分需要縫針的傷口都是在五至七天可以拆線。請自行安排時間來拆線。\r\n5. 手術時支付的費用已包含覆診和拆線, 若有什麼問題，可隨時詢問，費用全免。','親愛的客戶{{named}}，多謝你今天蒞臨123醫務中心，針對你今天做的小手術有幾個注意事項要提一提你\r\n1. 傷口今天不要濕水\r\n2. 若傷口出現異常痛楚 / 出血 / 麻痺感覺 / 爆線，請第一時間通知我們。Tel: 55448155 (Whatsapp / 微訊) / 37020123. \r\n3. 傷口癒合需要四大元素，包括適當溫度，濕度和透氣，並且沒有發炎。選擇適合敷料非常重要，記得先用藥水清洗傷口，再放上紗布。\r\n4. 大部分需要縫針的傷口都是在五至七天可以拆線。請自行安排時間來拆線。\r\n5. 手術時支付的費用已包含覆診和拆線, 若有什麼問題，可隨時詢問，費用全免。',1,1,'2020-06-26 14:31:26.335827',2,10),(31,'181450','181450','Dear {{named}}, welcome to 123 Medical Centre. There are few warm reminders to you concerning the minor operations you have done today. \r\n1. No water for coming 24 hours please.\r\n2. Contact us immediately in cases of uncontrolled bleeding, extra ordinary pain, numbness or sensory loss, wound dehiscence. Tel: 55448155 (Whatsapp / Wechat) / 37020123.\r\n3. Wound healing depends on TIME... Temperature, no Infection, Moisture and Evaporation. That is why an appropriate dressing cover is advised. For enquiry, please do not hesitate to contact us.\r\n4. For wound with stitches applied, please return 5 to 7 days for removal of stitches.\r\n5. The fee paid at surgery date has already covered all medication and follow up, so please do come back for any enquiries.','Dear {{named}}, welcome to 123 Medical Centre. There are few warm reminders to you concerning the minor operations you have done today. \r\n1. No water for coming 24 hours please.\r\n2. Contact us immediately in cases of uncontrolled bleeding, extra ordinary pain, numbness or sensory loss, wound dehiscence. Tel: 55448155 (Whatsapp / Wechat) / 37020123.\r\n3. Wound healing depends on TIME... Temperature, no Infection, Moisture and Evaporation. That is why an appropriate dressing cover is advised. For enquiry, please do not hesitate to contact us.\r\n4. For wound with stitches applied, please return 5 to 7 days for removal of stitches.\r\n5. The fee paid at surgery date has already covered all medication and follow up, so please do come back for any enquiries.',2,1,'2020-06-26 14:32:16.432683',2,10),(32,'181451','181452','親愛的客戶{{named}}，多謝你今天蒞臨123醫務中心， 1064 / 532 / 808nm 激光, 有美白 / 去斑 / 收緊毛孔 / 嫩膚 / 去血管絲等多種功能， 效果會隨著接受療程次數多少而一次比一次好。 最快可以四星期來做，來之前敬請預約。\r\n以下有幾點是做完激光後的注意事項\r\n1. 防曬是終生職業，特別是激光後首兩星期，每天出門前記得要搽防曬，SPF 30, PA 3+ 已足夠。\r\n2. 正常洗面便可，盡量避免搽太多化妝品。\r\n3. 做完激光後首兩星期，應避免游水，曬日光浴。\r\n4. 建議使用今天給你的口服抗敏感藥和搽面的抗敏感藥膏。可舒緩激光後皮膚痕癢的情況。\r\n5. 要達至做激光的最佳效果，必須保持充足睡眠，充足水分，避免太多壓力。和要有恆心讓皮下血管把黑色素帶走，需時可以是數個月至一兩年。\r\n6. 有一部分人首數次接受激光後，皮膚有機會會更黑多一點，但不用擔心，這是正常的現象，會有其他方法讓它慢慢變白。','溫馨提示，親愛的客戶{{named}}， 繼上次做完激光後已經有四星期以上，你可隨時來做第二次激光。最佳做激光時間是放假前，敬請先預約。',1,1,'2020-06-26 14:43:15.238226',3,11),(34,'181451','181452','Dear {{named}}, Welcome to visit 123 Medical Centre. We hope you enjoy our hospitable service. The combination of 1064 / 532 / 808 laser treatment is good at skin rejuvenation, depigmentation, polish poles, whitening effect, removal of telangiectasia. Upon few treatment cycles, skin color and quality are expected to improve. You are advised to receive next laser treatment 4 weeks later to achieve the best effect. Please kindly reserve your booking with our nurses in advance. \r\nHere are few warm tips to you\r\n1. Always do sun protection, especially before you leave home in morning. Sun block of SPF 30, PA 3+ is good enough, re-apply 3 hours later if persistent sun exposure is expected. \r\n2. Clean face as usual. You may continue to use your own facial cleanser. Avoid too much makeup.\r\n3. Avoid swimming, sunna in coming few days.\r\n4. Use the dispensed topical cream and anti-itchiness drug can relieve the skin discomfort on first few days after laser treatment\r\n5. Few cycles of laser treatments are required to achieve the best good result, so please be patient. \r\n6. Some people may experience darkening of skin after few cycles of laser treatment. This is a physiological change. Do not panic, there are many ways to tackle this problem.','Warm reminder, Dear {{named}}, there has been more than 4 weeks since last laser treatment at 123 Medical Centre. You are warmly welcome to receive further treatment. Kindly make your appointment in advance. The best time for laser treatment is right before holiday.',2,1,'2020-06-26 14:45:03.680447',3,11),(35,'181453','181453','親愛的客戶{{named}}，多謝你今天蒞臨123醫務中心，今天用了808nm 激光去毛，效果會隨著接受療程次數多少而一次比一次好。建議三星期後再來做，來之前敬請預約。\r\n以下有幾點是做完激光後的注意事項\r\n1. 防曬是終生職業，特別是激光後首兩星期，每天出門前記得要搽防曬，SPF 30, PA 3+ 已足夠。\r\n2. 做完激光後首兩星期，應避免游水，曬日光浴。\r\n3. 要達至做激光的最佳效果，必須保持充足睡眠，充足水分，避免太多壓力。 \r\n4. 三次去毛療程約可減少毛髮一半，大部分人做六至九次已有很明顯的去毛效果。','親愛的客戶{{named}}，多謝你今天蒞臨123醫務中心，今天用了808nm 激光去毛，效果會隨著接受療程次數多少而一次比一次好。建議三星期後再來做，來之前敬請預約。\r\n以下有幾點是做完激光後的注意事項\r\n1. 防曬是終生職業，特別是激光後首兩星期，每天出門前記得要搽防曬，SPF 30, PA 3+ 已足夠。\r\n2. 做完激光後首兩星期，應避免游水，曬日光浴。\r\n3. 要達至做激光的最佳效果，必須保持充足睡眠，充足水分，避免太多壓力。 \r\n4. 三次去毛療程約可減少毛髮一半，大部分人做六至九次已有很明顯的去毛效果。',1,1,'2020-06-26 14:45:51.512439',3,12),(36,'181453','181453','Dear {{named}}, welcome to 123 Medical Centre. Hope you enjoy our hospitable service. Epilation by laser is a long lasting option to get rid of body hair. The main concern is the pain during treatment, which can be controlled by oral pre-medication and application of anaesthetic cream. You are advised to re-do epilation laser 3 weeks later. Here are few warm reminders\r\n1. Always do sun protection, especially before you leave home in morning. Sun block of SPF 30, PA 3+ is good enough, re-apply 3 hours later if persistent sun exposure is expected. \r\n2. Avoid swimming, sunna in coming few days.\r\n3. Few cycles of laser treatments are required to achieve the best good result, so please be patient. Maintain adequate sleep, hyadration and avoid excessive stress.\r\n4. 3 cycles of epilation laser can reduce half of hair in general, most people experience excellent satisfaction after 6 to 9 cycles.','Dear {{named}}, welcome to 123 Medical Centre. Hope you enjoy our hospitable service. Epilation by laser is a long lasting option to get rid of body hair. The main concern is the pain during treatment, which can be controlled by oral pre-medication and application of anaesthetic cream. You are advised to re-do epilation laser 3 weeks later. Here are few warm reminders\r\n1. Always do sun protection, especially before you leave home in morning. Sun block of SPF 30, PA 3+ is good enough, re-apply 3 hours later if persistent sun exposure is expected. \r\n2. Avoid swimming, sunna in coming few days.\r\n3. Few cycles of laser treatments are required to achieve the best good result, so please be patient. Maintain adequate sleep, hyadration and avoid excessive stress.\r\n4. 3 cycles of epilation laser can reduce half of hair in general, most people experience excellent satisfaction after 6 to 9 cycles.',2,1,'2020-06-26 14:46:18.333996',3,12),(37,'222','001','再次選購通知：多謝客人曾選購 Takeda Calcichew D3 Chewable Tablets 1000mg/800iux，如果已服用完畢，歡迎到我們的網站再次選購。','再次選購通知：多謝客人曾選購 Takeda Calcichew D3 Chewable Tablets 1000mg/800iux，如果已服用完畢，歡迎到我們的網站再次選購。',1,1,'2020-09-24 03:14:43.469260',7,15),(38,'181407','001','再次選購通知：多謝客人曾選購“富生 超級樂骨康 (30粒)”，如果已服用完畢，歡迎到我們的網站再次選購。','再次選購通知：多謝客人曾選購“富生 超級樂骨康 (30粒)”，如果已服用完畢，歡迎到我們的網站再次選購。',1,1,'2020-09-24 03:15:12.779071',7,16),(39,'181407','001','再次選購通知：多謝客人曾選購“益生菌咀嚼片 (草莓乳酪味)”，如果已服用完畢，歡迎到我們的網站再次選購。','再次選購通知：多謝客人曾選購“益生菌咀嚼片 (草莓乳酪味)”，如果已服用完畢，歡迎到我們的網站再次選購。',1,1,'2020-09-24 03:15:29.183040',7,17),(40,'181429','001','新產品推出通知：\r\n“天醫 輔酶Q10”  現已於網站上架，歡迎到網站選購！“天醫 輔酶Q10” 是一種高抗氧化物，其抗氧化能力比維他命E高數十倍。加拿大製造。','新產品推出通知：\r\n“天醫 輔酶Q10”  現已於網站上架，歡迎到網站選購！“天醫 輔酶Q10” 是一種高抗氧化物，其抗氧化能力比維他命E高數十倍。加拿大製造。',1,1,'2020-09-24 03:15:47.200123',7,18),(41,'181451','001','再次選購通知：多謝客人曾選購“活得易益生菌滴劑”，如果已服用完畢，歡迎到我們的網站再次選購。','再次選購通知：多謝客人曾選購“活得易益生菌滴劑”，如果已服用完畢，歡迎到我們的網站再次選購。',1,1,'2020-09-24 03:16:02.853707',7,19),(42,'181407','001','由今天開始，＞50歲，＜12歲人士可來荃灣123醫務中心接種流感疫苗，有噴鼻疫苗。一星期開六天半。電: 37020123 /55448144','由今天開始，＞50歲，＜12歲人士可來荃灣123醫務中心接種流感疫苗，有噴鼻疫苗。一星期開六天半。電: 37020123 /55448144',1,1,'2020-10-07 03:25:56.345318',1,20);
